import React, {Component} from "react";
import './Login.css';
import TextField from "@material-ui/core/TextField";
import {InputAdornment, IconButton, Grid, Typography} from "@material-ui/core";
import {AccountCircleTwoTone, LockTwoTone, EmailTwoTone, Visibility, VisibilityOff} from '@material-ui/icons';

class Login extends Component {
    constructor(props) {
        super(props);
        this.state = {
            username: null,
            password: null,
            confirmPassword: null,
            email: null,
            showPassword: false,
            showConfirmPassword: false,
        };

        this.handleClickShowPassword = this.handleClickShowPassword.bind(this);
        this.handleChange = this.handleChange.bind(this);
        this.handleClickShowConfirmPassword = this.handleClickShowConfirmPassword.bind(this);
    }

    handleClickShowPassword() {
        this.setState({
            showPassword: !this.state.showPassword
        });
    }

    handleClickShowConfirmPassword() {
        this.setState({
            showConfirmPassword: !this.state.showConfirmPassword
        });
    }

    handleChange(event) {
        this.setState({
            [event.target.name]: event.target.value
        });
    }

    render() {
        return (
            <div className="Login">
                <Typography variant="h4" gutterBottom>
                    Register
                </Typography>
                <form>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <EmailTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-email"
                                label="Email"
                                name="email"
                                type="email"
                                onChange={this.handleChange}
                            />
                        </Grid>
                    </Grid>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <AccountCircleTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-username"
                                label="Username"
                                name="username"
                                onChange={this.handleChange}
                            />
                        </Grid>
                    </Grid>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <LockTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-password"
                                type={this.state.showPassword ? 'text' : 'password'}
                                label="Password"
                                autoComplete='off'
                                name="password"

                                onChange={this.handleChange}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                aria-label="Toggle password visibility"
                                                onClick={this.handleClickShowPassword}
                                            >
                                                {this.state.showPassword ? <VisibilityOff/> : <Visibility/>}
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        </Grid>
                    </Grid>
                    <Grid container spacing={8} alignItems="flex-end">
                        <Grid item>
                            <LockTwoTone/>
                        </Grid>
                        <Grid item>
                            <TextField
                                id="outlined-adornment-confirm-password"
                                type={this.state.showConfirmPassword ? 'text' : 'password'}
                                label="Confirm Password"
                                autoComplete='off'
                                name="confirmPassword"

                                onChange={this.handleChange}
                                InputProps={{
                                    endAdornment: (
                                        <InputAdornment position="end">
                                            <IconButton
                                                aria-label="Toggle password visibility"
                                                onClick={this.handleClickShowConfirmPassword}
                                            >
                                                {this.state.showConfirmPassword ? <VisibilityOff/> :
                                                    <Visibility/>}
                                            </IconButton>
                                        </InputAdornment>
                                    ),
                                }}
                            />
                        </Grid>
                    </Grid>
                </form>
            </div>
        );
    }
}

export default Login;
